function [dom, sol, f] = manufactured_solution(n, nu, nv)
% Construct a manufactured solution and RHS for the stellarator.

dom = surfacemesh.stellarator(n, nu, nv);

% The solution will be the Coulomb potential
x0 = [0 0 3];
solf = @(x,y,z) 1./sqrt((x-x0(1)).^2+(y-x0(2)).^2+(z-x0(3)).^2);
sol = surfacefun(solf, dom);
sol = sol - mean2(sol);

% Evaluate the analytically-derived RHS that gives this solution
ubreaks = linspace(0, 2*pi, nu+1);
vbreaks = linspace(0, 2*pi, nv+1);
vals = cell(nu*nv, 1);
k = 1;
for ku = 1:nu
    for kv = 1:nv
        [uu, vv] = chebpts2(n, n, [ubreaks(ku:ku+1) vbreaks(kv:kv+1)]);
        vals{k} = analytic_f_003(uu, vv);
        k = k+1;
    end
end

% Make sure to match the ordering in surfacemesh.stellarator
if ( bitand(nv, nv-1) == 0 && bitand(nu, nu-1) == 0 )
    ordering = morton(nv, nu);
    vals(ordering(:)) = vals;
end
f = surfacefun(vals, dom);

end

